  const URI="http://localhost:4000"
  let userData={}
  const navigate=useNavigate()
  useEffect(()=>{
    if (localStorage.getItem("user")===undefined){
      navigate("/")
    }else{
      axios.get(URI+"/userData").then(res=>{
        userData=res.data;
      })
    }
  },[])
  
  
  const clickHandler=()=>{

    navigate("/")
  }
   
